Here is an example of how to calculate the product of three prime numbers that are larger than 100, using Go.

```go
package main
import "log"
import "fmt"

func main() {
    primes := []int{101, 101 and 103}
    product := 1
    for _, prime := range primes {
        product *= prime
    }
    log.Printf("The product of %d, %d, and %d is %d.\n", primes[0], primes[1], primes[2], product)
}
```

This code will calculate the product of the three prime numbers 101, 101 and 103. The output will be the product of 101, 101, and 103.

Please note that the product of the three prime numbers is 101, 101, and 103.

